import { Container, Row, Col, Image } from 'react-bootstrap';
import '../../images/avatar.jpeg'

const About = () => {
  return (
    <Container className="pt-5">
      <Row>
        <Col xs={12} md={4}>
        <Image src="avatar.jpeg" rounded fluid />

        </Col>
        <Col xs={12} md={8}>
          <p>Hi, I'm [Your Name]! I'm a [Your Profession/Role] based in [Your Location]. I have [Number of Years] years of experience working with [Your Skills/Technologies]. In my free time, I enjoy [Your Hobbies/Interests]. Feel free to contact me at [Your Email Address] to discuss any potential projects or collaborations!</p>
        </Col>
      </Row>
    </Container>
  );
}

export default About;
